import styled from "styled-components";
import { createGlobalStyle } from 'styled-components'
import Corbel from '../../Resources/corbel.ttf'

createGlobalStyle`
  @font-face {
    font-family: 'corbel';
    src: url('../../Resources/corbel.ttf');
  }
`
const Tema1_2 = styled.div`
    background: #26273D;
    min-height: 100%;
    min-height: 100vh;
    overflow: auto;    
`;

const Tema1_2_H1 = styled.h1`
    color: #A3A7B0;
    font-size: 30px;
    font-family: corbel;
    font-weight: 800;
    text-align: center;
`;

const Tema1_2_LoginCentralizar = styled.div`
    width: 300px;
    margin: auto;
    position: absolute
    top: 50%
    left: 50%
    margin-right: -50%
    transform: translate(-50%, -50%)
`;

const Tema1_2_LoginBTN = styled.button`
background-color: #46B38C
border-color: #46B38C
width: 100%
height: 40px  
color: #DFDFDF
font-family: corbel
font-weight: 800
font-size: 18px
border-width: thin
button:onclick {
    width:70px;
    height:74px;
}
`;

const Tema1_2_LoginInput = styled.div`
input
{
    background-color: #26273D!important;
    border-color: #46B38C!important;
    border: 1px solid #ced4da!important;    
    border-radius: 2px!important; 
    font-weight: 800;
    color: #A3A7B0;
}
`;

console.log("TESTE");

export {Tema1_2, Tema1_2_H1, Tema1_2_LoginCentralizar, Tema1_2_LoginBTN, Tema1_2_LoginInput} ;
